import React, {Component} from 'react'
import 'bootstrap/dist/css/bootstrap.min.css'
import bgimg from '../img/OMK.svg'
import Logo from '../parts/logo.jsx'
class StudentPage extends Component {
    constructor() {
   
        super();
        this.state = {
            products: [],
        }
      }
      componentDidMount() {
        fetch('C:/Users/Vashu/Desktop/example.txt')
            .then(response => {
                return response.json();
            })
            .then(products => {
                this.setState({ products });
            });
      }
     
     renderProducts() {
        return this.state.products.map(product => {
            return (
                <li key={product.id} >
                    { product.title } 
                </li>      
            );
        })
      }
    render() {
        return (
            <div style={bgimgStyle} className="container-fluid">
    <ul>{this.renderProducts()}</ul>
                <Logo />
            </div>
        )
    }}
const bgimgStyle = {
    background: 'url('+ bgimg +') no-repeat right fixed',
    backgroundSize: 'auto 95%',
    width: '100%',
    height: '100%',
}
    export default StudentPage
